// Constants
const KM_TO_METERS = 1000; // Conversion factor from kilometers to meters

function applyBuffer() {
  // Get the buffer distance and unit from the input fields
  const distance = document.getElementById('buffer-distance').value;
  const distanceUnit = document.getElementById('unit').value;

  // Convert distance to meters if the unit is kilometers
  const bufferDistance = distanceUnit === 'kilometers' ? distance * KM_TO_METERS : distance;

  // Create the buffer using Turf.js
  const buffer = turf.buffer(geoJSON, bufferDistance, {
    units: 'meters', // Turf.js expects 'meters' as units
    // Add other options as needed, e.g., steps, endCapStyle, etc.
  });

  // Add the buffer to the map as a new GeoJSON layer
  const bufferLayer = L.geoJson(buffer, {
    style: {
      color: 'orange',
      weight: 2,
    },
    interactive: true, // Enable interaction with the layer
    onEachFeature: function(feature, layer) {
      // Add a click event to fit the map bounds to the clicked buffer feature
      layer.on("click", function(e) {
        map.fitBounds(layer.getBounds());
      });
    }
  }).addTo(map);
}

// Add event listener to the button to apply the buffer when clicked
document.getElementById('apply-buffer').addEventListener('click', applyBuffer);

